Для ЗАКАЗА ПАРФЮМЕРИИ отправьте мне в личку
- ссылку на парфюм (желательно с разными вариантами замены, вдруг чего-то не будет) или посмотрите каталог в группе, также можно скачать прайс-лист.

Для оформления заказа отправьте свои: 
-ФИО;
-Индекс;
-Адрес;
-Мобильный номер телефона;
Высылаем Укрпочтой или курьером. 

Пересылаем за счет покупателя(15-25грн). 

ВСЕМ всегда рад, так что заходите-выбирайте-покупайте!

Удачного Вам дня:)
